body {
  padding-top: 30px;
  background: url("https://storage.needpix.com/rsynced_images/old-paper-texture-background-1380404417tNE.jpg");
  background-repeat: no-repeat;
  background-size: cover;
}

/* image */
img {
  width: 100%;
}

/* fonts */
h1 {
  text-align: center;
  font-size: 50px;
  font-family: 'Dancing Script', cursive;
  font-weight: bold;
  margin: 0 0 20px;
	color: #000;
  padding: 30px 0;
}

h2, h3, p {
  font-family: 'Crimson Text', serif;
}

h2 {
	font-size: 48px;
	margin: 0 0 18px;
}

h3 {
	font-size: 20px;
	margin: 0 0 15px;
}

p {
  font-size: 14px;
}

.wrapper {
  max-width: 1440px;
  width: 90%;
  margin: 0 auto;
  padding: 0 30px;
  border: 3px dashed #ddd;
}

span {
  font-size: 15px;
}

.spicy:before {
  width: 16px;
  height: 16px;
  content: "";
  background-image: url("/0951dab286aec74a3a83655dc01b4fda.svg");
  background-repeat: no-repeat;
  display: inline-block;
  padding-right: 3px;
  position: relative;
  top: 2px;
}

footer {
  padding: 10px 0;
  margin-top: 20px;
  text-align: center;
}

section {
  margin-top: 50px;
}


section#pizza {
  margin: 250px 0;
}

.card-content-container {
  padding: 10px 5px 20px;
  background: grey;
}


/* credit: https://w3bits.com/css-masonry/ */

.masonry {
  display: grid;
  grid-gap: 2em; 
  grid-template-columns: repeat( auto-fill, minmax( 230px, 1fr ) );
  grid-auto-rows: 250px;
}

/* 
  ##Device = Tablets, Ipads (portrait)
  ##Screen = B/w 768px to 1024px
*/

@media (min-width: 768px) and (max-width: 1024px) {

  .masonry {
    grid-template-columns: repeat( auto-fill, minmax( 180px, 1fr ) );
    grid-auto-rows: 210px;

  }

  section#pasta .masonry {
    grid-template-columns: repeat( auto-fill, minmax( 180px, 1fr ) );
    grid-auto-rows: 350px;
  }

  section#pizza {
    margin: 0 0 250px 0;
  }
}


/* 
  ##Device = Low Resolution Tablets, Mobiles (Landscape)
  ##Screen = B/w 481px to 767px
*/

@media (min-width: 481px) and (max-width: 767px) {

  .masonry {
  display: flex;
    flex-direction: column;
} 

section,section#pizza {
  margin: 20px 0;
} 
}

